import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [user, setUser] = useState(null);
  const [currentView, setCurrentView] = useState('login');

  // Mock login function
  const login = (email, password) => {
    const users = {
      'student@luct.com': { name: 'John Student', role: 'student', password: 'student123' },
      'lecturer@luct.com': { name: 'Dr. Smith', role: 'lecturer', password: 'lecturer123' },
      'prl@luct.com': { name: 'Prof. Johnson', role: 'principal_lecturer', password: 'prl123' },
      'pl@luct.com': { name: 'Dr. Wilson', role: 'program_leader', password: 'pl123' }
    };

    if (users[email] && users[email].password === password) {
      setUser(users[email]);
      setCurrentView('dashboard');
      return true;
    }
    return false;
  };

  const logout = () => {
    setUser(null);
    setCurrentView('login');
  };

  // Login Component
  const Login = () => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');

    const handleSubmit = (e) => {
      e.preventDefault();
      if (!login(email, password)) {
        setError('Invalid credentials');
      }
    };

    const fillDemo = (role) => {
      const demos = {
        student: ['student@luct.com', 'student123'],
        lecturer: ['lecturer@luct.com', 'lecturer123'],
        principal_lecturer: ['prl@luct.com', 'prl123'],
        program_leader: ['pl@luct.com', 'pl123']
      };
      setEmail(demos[role][0]);
      setPassword(demos[role][1]);
    };

    return (
      <div className="login-container">
        <div className="login-form">
          <h2>LUCT Faculty Reporting System</h2>
          {error && <div style={{color: 'red', marginBottom: '1rem'}}>{error}</div>}
          
          <form onSubmit={handleSubmit} className="form">
            <input type="email" placeholder="Email" value={email} onChange={(e) => setEmail(e.target.value)} required />
            <input type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} required />
            <button type="submit">Sign In</button>
          </form>

          <div style={{marginTop: '2rem'}}>
            <h4>Demo Accounts:</h4>
            <div style={{display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '0.5rem', marginTop: '1rem'}}>
              <button type="button" onClick={() => fillDemo('student')}>Student</button>
              <button type="button" onClick={() => fillDemo('lecturer')}>Lecturer</button>
              <button type="button" onClick={() => fillDemo('principal_lecturer')}>PRL</button>
              <button type="button" onClick={() => fillDemo('program_leader')}>PL</button>
            </div>
          </div>
        </div>
      </div>
    );
  };

  // Dashboard Component
  const Dashboard = () => {
    return (
      <div>
        <div className="navbar">
          <div className="logo-area">
            <div className="logo"></div>
            <span className="brand">LUCT Reporting</span>
          </div>
          <div className="nav-links">
            <span style={{color: '#ffda77'}}>{user?.name} ({user?.role})</span>
            <button onClick={logout} style={{marginLeft: '1rem'}}>Logout</button>
          </div>
        </div>

        <div className="main-content">
          <div className="dashboard-top">
            <h2>Welcome, {user?.name}!</h2>
            <span className={`role-badge role-${user?.role}`}>
              {user?.role?.replace('_', ' ')}
            </span>
          </div>
          
          <div className="dashboard-top">
            <div className="card">
              <h3>Total Reports</h3>
              <p>24</p>
            </div>
            <div className="card">
              <h3>Classes</h3>
              <p>5</p>
            </div>
            <div className="card">
              <h3>Students</h3>
              <p>180</p>
            </div>
          </div>

          <div className="section">
            <h3>System Features</h3>
            <p>LUCT Faculty Reporting System - All modules working</p>
            <div style={{marginTop: '1rem'}}>
              <button onClick={() => setCurrentView('reports')}>View Reports</button>
              {user?.role === 'lecturer' && (
                <button onClick={() => setCurrentView('report-form')} style={{marginLeft: '1rem'}}>
                  Submit Report
                </button>
              )}
            </div>
          </div>
        </div>
      </div>
    );
  };

  // Reports Component
  const ReportsView = () => {
    return (
      <div>
        <div className="navbar">
          <div className="logo-area">
            <div className="logo"></div>
            <span className="brand">LUCT Reporting</span>
          </div>
          <div className="nav-links">
            <button onClick={() => setCurrentView('dashboard')}>Dashboard</button>
            <span style={{color: '#ffda77'}}>{user?.name}</span>
            <button onClick={logout} style={{marginLeft: '1rem'}}>Logout</button>
          </div>
        </div>

        <div className="main-content">
          <h2>Lecture Reports</h2>
          <div className="section">
            <p>All reporting functionality would be here.</p>
            <button onClick={() => setCurrentView('dashboard')}>Back to Dashboard</button>
          </div>
        </div>
      </div>
    );
  };

  // Render based on current view
  if (currentView === 'login' || !user) {
    return <Login />;
  }

  if (currentView === 'reports') {
    return <ReportsView />;
  }

  return <Dashboard />;
}

export default App;
